import React from 'react';
import './loginfields.css'

class LField extends React.Component
{

	renderButton(buttonName)
	{
		if (buttonName === "login")
		{
			return(
				<div className="loginbuttoncontainer">
					<button className="button">
						LOGIN
						</button>
						</div>
			);
		}
	}

	renderSignupButton()
	{
		return(
			<div className="signupbuttoncontainer">
				<button className="button">
					LOGIN
				</button>
			</div>
		);
	}

	render()
	{
		const fieldVal = this.props.value;

		if (fieldVal === "username" || fieldVal === "password")
		{
			return(
				<div className="loginfield">
					{fieldVal}
				</div>
			);
		}

		return(
			<div className="loginbuttonfield">

			</div>
		);


	}

}

export default LField;
